<H1><A NAME="vb_e_terrldbadvbxversion"></A>File &lt;name&gt; is out of date.</H1>

<P class=T>This error generally occurs when the version of oleaut32.dll on your machine is older than the version of the file the product is attempting to use.</P>

<P><B>To correct this error</B>

<UL>
	<LI class=LB1>Re-install the product to install the correct version of the file on your machine.</LI>
</UL>
